        <div className="nav">
            <div className="nav-wap">
                <Link
                    className="nav-list logo"
                    to={"page0"}
                    toShowHeight
                    onFocus={this.onFocus}
                    onBlur={this.onBlur}>
                    AlÃª Almeida
                </Link>
                {content.map(i => (
                    <Link
                        className="nav-list"
                        to={i.hash}
                        toShowHeight
                        onFocus={this.onFocus}
                        onBlur={this.onBlur}>
                        Example2
                    </Link>
                ))}
                <div ref= {(c) => { this.bar = c; } } className="nav-bar"/>
            </div>
        </div>
)

